const parse = str => {
  try {
    // Предварительные замены
    str = str
    .replace(/\s+/g, '') // Убираем все пробелы и переносы
    .replace(/(\[|\,)\s*\./g, '$10.')
    .replace(/(\[|\,)\s*-\./g, '$1-0.')
    .replace(/\[,/g, '[null,')
    .replace(/,,\]/g, ',null]')
    .replace(/,\s*(?=[,\]])/g, ',null')
    .replace(/nul(?!\w)/g, 'null') // Исправляем обрезанное 'nul' -> 'null'
    // Проверяем сбалансированность скобок
    let bracketCount = 0;
    for (let i = 0; i < str.length; i++) {
      if (str[i] === '[') bracketCount++;
      if (str[i] === ']') bracketCount--;

      if (bracketCount < 0) {
        console.error(`Обнаружена несбалансированная закрывающая скобка в позиции ${i}`);
        break;
      }
    }

    if (bracketCount !== 0) {
      console.error(`Несбалансированные скобки: открыто ${bracketCount} скобок, которые не были закрыты`);
    }

    // Выводим контекст ошибки, если она все еще происходит
    try {
      return JSON.parse(str, (key, value) => {
        if (value === null) return undefined;
        return value;
      });
    } catch (e) {
      if (e instanceof SyntaxError) {
        const match = e.message.match(/position (\d+)/);
        if (match) {
          const pos = parseInt(match[1]);
          const context = str.substring(Math.max(0, pos - 30), Math.min(str.length, pos + 30));
          console.error(`Ошибка JSON в позиции ${pos}. Контекст: ${context}`);

          // Визуализация точной позиции ошибки
          console.error('Точная позиция: ' +
            context.substring(0, 30) +
            ' >>> ' +
            str.charAt(pos) +
            ' <<< ' +
            context.substring(31));
        }
      }
      throw e;
    }
  } catch (e) {
    console.error("Ошибка при парсинге:", e);
    throw e;
  }
};
