export async function stopLevelMusic(GameState) {
  if (GameState.musicNode) {
    GameState.musicNode.stop();
  }
  GameState.currentlyPlayingTrack = null;
}

export async function playLevelMusic(trackName, GameState) {
  if (GameState.currentlyPlayingTrack === trackName) {
    return
  } else {
    if (GameState.musicNode) {
      GameState.musicNode.stop()
    }
  }
  GameState.currentlyPlayingTrack = trackName;
  const musicToPlay = levelTrack[GameState.currentlyPlayingTrack];
  const music = parse(musicToPlay)
  const buffer = zzfxM(...music)
  GameState.musicNode = zzfxP(...buffer);
  GameState.musicNode.loop = true;
  await zzfxX.resume();
}

